import rain from './rain.svg';
import clearDay from './clear-day.svg';
import fog from './fog.svg';
import wind from './wind.svg';
import snow from './snow.svg';
import thunder from './thunder.svg';
import cloudy from './cloudy.svg';
import partlyCloudyDay from './partly-cloudy-day.svg'
import rainSnow from "./rain-snow.svg"
import hail from "./hail.svg"
import partlyCloudNight from "./partly-cloudy-night.svg"
import rainSnowShowersDay from "./rain-snow-showers-day.svg"

export class IMG {

    'rain' = rain

    'clear-day' = clearDay

    'fog' = fog

    'wind' = wind

    'snow' = snow

    'thunder' = thunder

    'cloudy' = cloudy

    'partly-cloudy-day' = partlyCloudyDay

    'rain-snow' = rainSnow

    'hail' = hail

    'partly-cloud-night.svg' = partlyCloudNight

    'rain-snow-showers-day' = rainSnowShowersDay
}

export class Cities {
    'London' = 'https://a.cdn-hotels.com/gdcs/production153/d1371/e6c1f55e-51ac-41d5-8c63-2d0c63faf59e.jpg'
    'Paris' = 'https://www.thetrainline.com/cms/media/1360/france-eiffel-tower-paris.jpg?mode=crop&width=1080&height=1080&quality=70'
    'New york' = 'https://upload.wikimedia.org/wikipedia/commons/4/47/New_york_times_square-terabass.jpg'
    'Kyiv' = 'https://lp-cms-production.imgix.net/2019-06/a6469f3993128cbcdde6e2b0a90aa1d3-kyiv.jpg'
}
export default IMG;
